('2406','18','7233-4','Kurz',Null,'Neu renovierte Golfvilla am Golfplatz Santa Ponsa zu verkaufen','33807','In einer sehr beliebten Golfresidenz in Santa Ponsa befindet sich diese im Jahr 2015 renovierte Golfvilla. Sie hat ca 180m² Wohnfläche, die sich auf Hauptwohnebene mit Wohn-Esszimmer, moderne Einbauküche, Hauswirtschaftsraum, Gäste WC, 2 Schlafzimmer mit je einem Bad en suite, Wintergarten und separatem Gästezimmer im 1. OG verteilen. In Mitten eines angelegten Gartens befindet sich der priv. Pool. Des Weiteren hat es noch eine finnische- und eine Dampfsauna. Die Villa wurde im Außen- und Innenbereich mit hellen Fliesen ausgestattet, was ihr ein elegantes Aussehen  verschafft. Die Garage bietet Platz für 1 Auto und ein Golfcar. Zur technischen Ausstattung gehören eine elektr. Fußbodenheizung, Klima Anlage w/k, Kaminkasette, Klimalit Doppelglasfenster und eine schicke, weisse Einbauküche','33808','1060000','106','2015-12-03 12:47:23','106','2015-12-03 12:48:57',Null,'2527','121','1186',1,'1','0',Null,Null,Null,'33809',Null,'0','0','0',Null,'2015-12-03 12:57:06',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'33810',Null,'33811',Null,'33812',Null,'33813','669 660 702 Frau Kurz','33814','0',0,'0');
